
describe("Protractor Demo App",function(){var e=element(by.model("first"));var b=element(by.model("second"));var a=element(by.id("gobutton"));var f=element(by.binding("latest"));var d=element.all(by.repeater("result in memory"));function c(h,g){e.sendKeys(h);b.sendKeys(g);a.click()}beforeEach(function(){browser.get("http://juliemr.github.io/protractor-demo/")});it("should have a history",function(){c(1,2);c(3,4);expect(d.count()).toEqual(2);c(5,6);expect(d.count()).toEqual(3)});it("should have a history",function(){c(1,2);c(3,4);expect(d.last().getText()).toContain("1 + 2");expect(d.first().getText()).toContain("7")})});

 
